  const div = <div id={type}></div>;
  console.log(div);
  for (let i = 0; i < 7; i ++) {
    const list = List(type);
    div.addElement(list);
  }
  return div[0];
}

function List(type) {
  return <ul></ul>;
}

function Task(type) {
